        ADVANCE(2);
      if (lookahead == '\"')
        ADVANCE(4);
      if (lookahead == '#')
        ADVANCE(7);
      if (lookahead == '%')
        ADVANCE(38);
      if (lookahead == '&')
        ADVANCE(40);
      if (lookahead == '\'')
        ADVANCE(43);
      if (lookahead == '(')
        ADVANCE(48);
